import React, { Fragment } from "react";
import { Form, FormGroup } from "reactstrap";
  const AddCourse=()=>{
      return(
           <Fragment>
                <Form>
                    <FormGroup>
                        <label for="userId">Course Id</label>
                        <Input  
                            type="text" 
                            placeholder="Enter here" 
                            name="userId"
                            id="userId"
                           
                         />
                   </FormGroup> 
                </Form>
          
          </Fragment>

      );
  };

  export default AddCourse;
